import React, { Component } from "react"
 
class Home extends Component {
render() {
	  return (
	    <div className="body-wrapper">
	      <div className="page-content-wrapper">
	      	<div className="pulsate-bck">
	      		<div className="anim-text">Test</div>
	      	</div>
	      </div>      
	    </div>
	  )
	}
}
export default Home;
